import React, { Component } from 'react'

export class Sub extends Component {
        constructor(){
            super()
            this.state={
                val: 9
            }
        }
        add= () => {
           this.state.val = 1
        }

    render() {
        return (
            <div>
                <h1>{this.state.val}</h1>
             <button type="button" class="btn btn-dark">Tsedi</button>
            </div>
        )
    }
}

export default Sub;
